import React from "react";

const Login = () => {
  return (
    <>
      <div className="container-fluid ">
        <div className="row">
          <div className="col-8 m-auto py-auto bg-light">
            <div className="container ">
              <div className="row">
                <h1>login</h1>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default Login;
